	"sap/ushell/renderers/fiori2/HeadEndItemsOverflowPopover.fragment.xml":'<core:FragmentDefinition\n    xmlns="sap.m"\n    xmlns:core="sap.ui.core"><Popover\n        id="headEndItemsOverflow"\n        placement="Bottom"\n        showHeader="false"\n        showArrow="true"\n        class="sapUshellPopupContainer sapContrastPlus"\n        afterClose=".destroyHeadEndItemsOverflow"><content><List\n                id="headEndItemsOverflowList"\n                class="sapUshellPopoverList"\n                showSeparators="None"\n                items="{\n                    path: \'/headEndItems\',\n                    filters: {\n                        path: \'\',\n                        test: \'.isHeadEndItemInOverflow\'\n                    },\n                    factory: \'.headEndItemsOverflowItemFactory\'\n                }" /></content></Popover></core:FragmentDefinition>\n',
	"sap/ushell/renderers/fiori2/allMyApps/AllMyApps.view.xml":'<mvc:View\n    controllerName="sap.ushell.renderers.fiori2.allMyApps.AllMyApps"\n    xmlns="sap.m"\n    xmlns:mvc="sap.ui.core.mvc"\n    height="100%"><SplitApp\n        id="sapUshellAllMyAppsMasterDetail"\n        mode="{= ${/isPhoneWidth} ? \'ShowHideMode\' : \'StretchCompressMode\'}"\n        class="sapUshellAllMyAppsView"><masterPages><Page id="sapUshellAllMyAppsMasterPage" showHeader="false"><content><List\n                        id="sapUshellAllMyAppsDataSourcesList"\n                        tooltip="{i18n>catalogSelect_tooltip}"\n                        rememberSelections="true"\n                        items="{allMyAppsModel>/AppsData}"\n                        showNoData="false"\n                        growingThreshold="100"\n                        mode="SingleSelectMaster"\n                        itemPress=".handleMasterListItemPress"\n                        selectionChange=".handleMasterListItemPress"><StandardListItem\n                            title= "{allMyAppsModel>title}"\n                            type="{\n                                parts: [\'allMyAppsModel>type\', \'/allMyAppsMasterLevel\'],\n                                formatter: \'.formatListItemType\'\n                            }"></StandardListItem></List></content></Page></masterPages><detailPages><Page id="sapUshellAllMyAppsDetailsPage" showHeader="false"><content><Title id="sapUshellAllMyAppsDetailsHeaderLabel" wrapping="true" class="sapUiSmallMarginTopBottom"/><ScrollContainer\n                            id="allMyAppsScrollContainer"\n                            class="sapUshellAllMyAppsDetailsItemContainer"\n                            horizontal="false"\n                            vertical="true"><content><List id="oItemsContainerlist" items="{allMyAppsModel>apps}"><CustomListItem\n                                        class="sapUshellAllMyAppsListItem"\n                                        type="Active"\n                                        press=".onAppItemClick"><content><VBox><Label text="{allMyAppsModel>title}" class="sapUshellAllMyAppsItemTitle"/><Label\n                                                text="{allMyAppsModel>subTitle}"\n                                                visible="{= !!${allMyAppsModel>subTitle}}"\n                                                class="sapUshellAllMyAppsItemSubTitle"/></VBox></content></CustomListItem></List></content></ScrollContainer><VBox\n                        id="sapUshellAllMyAppsCustomPanel"\n                        visible="{= !!${allMyAppsModel>numberCustomTiles}}"\n                        class="sapUshellAllMyAppsCustomPanel"><Text id="sapUshellAllMyAppsCustomPanelLabel" text="{allMyAppsModel>sCustomLabel}" wrapping="true" /><Link\n                            id="sapUshellAllMyAppsCustomPanelLink"\n                            visible="{allMyAppsModel>/catalogEnabled}"\n                            text="{allMyAppsModel>sCustomLink}"\n                            press=".handleCustomPanelLinkPress"\n                            wrapping="true" /></VBox></content></Page><Page id="sapUshellAllMyAppsEmptyDetailsPage" showHeader="false" enableScrolling="false"><content><Label class="sapUshellAllMyAppsEmptyDetailsPageText" text="{i18n>AllMyAppsEmptyText}" textAlign="Center"/></content></Page></detailPages></SplitApp></mvc:View>\n',
